webpackJsonp([0x9c305df01c0c],{635:function(a,n){a.exports={data:{markdownRemark:{html:'<h3>Getting Started</h3>\n<p>We introduce the new <a href="/hackers/hacker-dashboard.html">Getting Started</a> page on the Hacker Dashboard. This will guide hackers and direct them to the right pages to help them get the information they need to successfully start out on HackerOne</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-3f330.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 52.05574912891986%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="getting started"\n        title=""\n        src="/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-e7ffa.png"\n        srcset="/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-49813.png 125w,\n/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-dc8a5.png 250w,\n/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-e7ffa.png 500w,\n/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-dda24.png 750w,\n/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-c5f18.png 1000w,\n/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-22484.png 1500w,\n/static/jan_2019_getting_started-3636cede8c5526e434c109712c349d05-3f330.png 2870w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Export All Reports</h3>\n<p>Want all of your report data for safe keeping or just for analytical purposes? Programs can now export all of their reports through our new <a href="/programs/export-reports.html">Export Reports</a> feature.  </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-da5c6.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 40.185471406491494%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="export reports"\n        title=""\n        src="/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-e7ffa.png"\n        srcset="/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-49813.png 125w,\n/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-dc8a5.png 250w,\n/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-e7ffa.png 500w,\n/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-dda24.png 750w,\n/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-c5f18.png 1000w,\n/static/jan_2019_export_reports-853fecf303134ed3dd0de4bee5b97afe-da5c6.png 1294w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Link HackerOne Reports to Existing Jira Tasks</h3>\n<p>Jira users can now <a href="/programs/jira-integration.html">link</a> their HackerOne reports to their existing Jira tasks.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-51a3c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.57856746252082%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="linking HackerOne to Jira"\n        title=""\n        src="/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-e7ffa.png"\n        srcset="/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-49813.png 125w,\n/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-dc8a5.png 250w,\n/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-e7ffa.png 500w,\n/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-dda24.png 750w,\n/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-c5f18.png 1000w,\n/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-22484.png 1500w,\n/static/jan_2019_link_jira-1b2240720904e132ac0e9e6458893ce8-51a3c.png 1801w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Selecting From Multiple Jira Projects</h3>\n<p>Jira users can also now select from multiple projects they want their Jira task to link to.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_jira_projects-cb3ac210077b4a09d979695ecaa7a9b8-3459e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 330px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.484848484848484%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="selecting projects"\n        title=""\n        src="/static/jan_2019_jira_projects-cb3ac210077b4a09d979695ecaa7a9b8-3459e.png"\n        srcset="/static/jan_2019_jira_projects-cb3ac210077b4a09d979695ecaa7a9b8-22dd8.png 125w,\n/static/jan_2019_jira_projects-cb3ac210077b4a09d979695ecaa7a9b8-92a48.png 250w,\n/static/jan_2019_jira_projects-cb3ac210077b4a09d979695ecaa7a9b8-3459e.png 330w"\n        sizes="(max-width: 330px) 100vw, 330px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Indian Rupee Payments</h3>\n<p>Hackers in India will no longer lose a portion of their bounty to transfer fees as we now support payments to <a href="https://hackerone.com/blog/Introducing-Indian-Rupee-payments-Cheaper-and-faster-bank-transfers">Indian Rupees</a>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_indian_rupee-57ac4cbb4db57e2be30f4d57dcd1df2c-c79d9.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 97.47081712062257%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="adding Indian Rupee"\n        title=""\n        src="/static/jan_2019_indian_rupee-57ac4cbb4db57e2be30f4d57dcd1df2c-e7ffa.png"\n        srcset="/static/jan_2019_indian_rupee-57ac4cbb4db57e2be30f4d57dcd1df2c-49813.png 125w,\n/static/jan_2019_indian_rupee-57ac4cbb4db57e2be30f4d57dcd1df2c-dc8a5.png 250w,\n/static/jan_2019_indian_rupee-57ac4cbb4db57e2be30f4d57dcd1df2c-e7ffa.png 500w,\n/static/jan_2019_indian_rupee-57ac4cbb4db57e2be30f4d57dcd1df2c-c79d9.png 514w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Improved Sign Up Page</h3>\n<p>When new users sign up to use HackerOne, they can can now more clearly distinguish whether they are a hacker or a company wanting to set up an account.  </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-a303a.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.839694656488554%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="sign up branching page"\n        title=""\n        src="/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-e7ffa.png"\n        srcset="/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-49813.png 125w,\n/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-dc8a5.png 250w,\n/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-e7ffa.png 500w,\n/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-dda24.png 750w,\n/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-c5f18.png 1000w,\n/static/jan_2019_signup-d2a8009782285aba0483792e52041d02-a303a.png 1310w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Account Preferences</h3>\n<p>You can now clearly define whether you\'re a hacker or someone running a program within the new Account Preferences tab under your profile settings. This will help tailor your HackerOne experience to better fit your needs.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-0a08e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 57.09382151029748%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="account preferences"\n        title=""\n        src="/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-e7ffa.png"\n        srcset="/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-49813.png 125w,\n/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-dc8a5.png 250w,\n/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-e7ffa.png 500w,\n/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-dda24.png 750w,\n/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-c5f18.png 1000w,\n/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-22484.png 1500w,\n/static/jan_2019_account_preferences-7cf90f29e9bfb20d89937dc8ce3538c1-0a08e.png 1748w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Infinite Scrolling</h3>\n<p>We\'ve now implemented infinite scrolling on multiple pages so that you no longer have to click on the <i>Load more</i> button to view more information. The information now automatically populates.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-3f82c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 37.205882352941174%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="infinite scrolling"\n        title=""\n        src="/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-e7ffa.png"\n        srcset="/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-49813.png 125w,\n/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-dc8a5.png 250w,\n/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-e7ffa.png 500w,\n/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-dda24.png 750w,\n/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-c5f18.png 1000w,\n/static/jan_2019_infitine_scrolling-1f9c1b653a2eb59b48cc0d1a0758a75f-3f82c.png 1360w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/changelog/2019/january",title:"January 2019"}}},pathContext:{}}}});
